import { connect } from 'react-redux';
import { closePopup } from '../../helper/events';
import {VoteComponent} from './voteComponent';

const mapStateToProps = ({popup})=>({
    popup
})

const mapDispatchToProps = dispatch =>({
    closePopup(value){
        closePopup
    }
})

export const VoteContainer = connect(mapStateToProps,null)(VoteComponent);
